import React from "react";
import { Menu } from "semantic-ui-react";
import { Link } from "../routes";

export default () => {
  return (
    <Menu>
      <Link route="/">
        <a className="item">E-B App</a>
      </Link>

      <Menu.Menu position="right">
        <Link route="/">
          <a className="item">Records</a>
        </Link>{" "}
        <Link route="/newPatient/register">
          <a className="item">+</a>
        </Link>
      </Menu.Menu>
    </Menu>
  );
};
